export default function Task(props) {
  const deleteTask = () => {
    fetch(`/home/${props.taskId}`, {
      method: 'DELETE',
    })
  }

  return (
    <div>
      <p>{props.task}</p>
      <button onClick={deleteTask}>delete</button>
    </div>
  );
}
